import React, {useState} from "react";
import { withRouter } from "react-router-dom";
import {connect} from "react-redux";
import {Card, Button} from 'react-bootstrap';


 class GetCardArticle extends React.Component{
    constructor(props){
        super(props);
        this.State = {
            list: []
        }
    }

    render(){
        return(
            <div>
                {this.state.list}
            </div>
        )
    }
}

function mapStateToProps(state) {
    return ({
        product: state.product
    });
};

export default connect(mapStateToProps, null)(withRouter(GetCardArticle))
